import React from "react";
import { robots } from "./robots";

const RoboCard = () => {
return (
	<div className="dib bg-light-green ma2 grow br3 pa4 bw2 shadow-5">
		<img alt="robots" src="https://robohash.org/4" />
		<h2>{robots[0].name}</h2>
		<p>Robot Email</p>
	</div>
	);
}

export default RoboCard;
